import React, { useState } from 'react';
import './AddEnclosureForm.css';

const AddEnclosureForm = ({ onAddEnclosure }) => {
  const [enclosure_id, setID] = useState('');
  const [name, setName] = useState('');
  const [enclosure_type, setType] = useState('');
  const [build_date, setBuildDate] = useState('');
  const [address, setAddress] = useState('');
  const [cleaning_start, setCleaningStart] = useState('');
  const [cleaning_end, setCleaningEnd] = useState('');

  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    if (!name || !enclosure_id || !enclosure_type || !build_date || !address || !cleaning_start || !cleaning_end) {
      alert('Please fill in all fields');
      return;
    }
    // Call the function passed from parent component to add enclosure
    onAddEnclosure({ enclosure_id, name, enclosure_type, build_date, address, cleaning_start, cleaning_end });
    // Reset form fields after submission
    handleReset();
  };

  // Function to reset form fields
  const handleReset = () => {
    setID('');
    setName('');
    setType('');
    setBuildDate('');
    setAddress('');
    setCleaningStart('');
    setCleaningEnd('');
  };

  return (
    <form onSubmit={handleSubmit} className="enclosure-form">
      <div className="form-group">
        <label htmlFor="enclosure_id">Enclosure ID:</label>
        <input
          type="number"
          id="enclosure_id"
          placeholder="Enclosure ID"
          value={enclosure_id}
          onChange={(e) => setID(e.target.value)}
          required
          min="0"
        />
      </div>
      <div className="form-group">
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="enclosure_type">Enclosure Type:</label>
        <input
          type="text"
          id="enclosure_type"
          placeholder="Enclosure Type"
          value={enclosure_type}
          onChange={(e) => setType(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="build_date">Build Date:</label>
        <input
          type="date"
          id="build_date"
          value={build_date}
          onChange={(e) => setBuildDate(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="address">Address:</label>
        <input
          type="text"
          id="address"
          placeholder="Address"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaning_start">Cleaning Start Time:</label>
        <input
          type="time"
          id="cleaning_start"
          value={cleaning_start}
          onChange={(e) => setCleaningStart(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaning_end">Cleaning End Time:</label>
        <input
          type="time"
          id="cleaning_end"
          value={cleaning_end}
          onChange={(e) => setCleaningEnd(e.target.value)}
          required
        />
      </div>
      <div className="form-actions">
        <button type="submit">Add Enclosure</button>
        <button type="button" onClick={handleReset}>Reset</button>
      </div>
    </form>
  );
};

export default AddEnclosureForm;
